const Input = ( {className, placeholder,onBlur,value} ) => {

  return (
    <div className='loop'>
      <input 
            className={className} 
            placeholder={placeholder} 
            value={value}
            onBlur={onBlur}
            />                
    </div>
  )
}

export default Input
